import React, {useState} from 'react'
import { Button } from '@mui/material';

function StartButton(props) {


  return (
    <Fragment>
      {(props.status === 0) ?
      <Button variant="contained" onClick={props.start}>Start</Button> : ""

    }
    </Fragment>
  )
}


export default StartButton

